$(document).ready(function() {
  AOS.init({
    disable: "mobile"
  }), $("[data-bs-hover-animate]").mouseenter(function() {
    var a = $(this);
    a.addClass("animated " + a.attr("data-bs-hover-animate"))
  }).mouseleave(function() {
    var a = $(this);
    a.removeClass("animated " + a.attr("data-bs-hover-animate"))
  })
}), $(document).ready(function() {
  var a = $("#navigation"),
    i = a.position().top;
  $(window).resize(function() {
    i = a.position().top
  }), $(window).scroll(function() {
    $(this).scrollTop() > i ? (a.addClass("sticky"), $(".logosmall").removeClass("hidels")) : (a.removeClass("sticky"), $(".logosmall").addClass("hidels"))
  }), $(".navResponsive").click(function() {
    $("nav ul.navHold").toggle()
  }), $("nav ul li.subNav").click(function() {
    $(this).children("ul").toggle()
  })
});
